import React from "react";
import SearchBar from "./SearchBar";
import _ from "lodash";

class App extends React.Component {
  constructor() {
    super();

    this.state = {
      stocks: [],
      term: null,
      value: "",
    };
  }

  onTermSubmit = (data) => {
    // const stocks = data["Time Series (Daily)"].map((time) => console.log(time));
    console.log(data);
    let stocks = _.flattenDeep(
      Array.from(data["Time Series (Daily)"]).map((stock) => [
        { symbol: stock["1. open"] },
      ])
    );
    console.log(stocks);
    this.setState((state, props) => {
      return {
        ...state,
        stocks,
      };
    });

    // .catch(error => console.log(error))
  };

  render() {
    return (
      <div className=" ui container">
        <SearchBar onTermSubmit={this.onTermSubmit} />
      </div>
    );
  }
}

export default App;
